import { useState } from "react";
import Ask from "./components/Ask";

const StartButton = () => {
  const [show, setShow] = useState(true);
  const startButtonHandle = () => {
    setShow(false);
  };
  return (
    <div>
      {show && <Ask />}
      <button onClick={startButtonHandle}>Start New Quiz</button>
    </div>
  );
};

export default StartButton;
